import { StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
   appButtonContainer: {
    elevation: 12,
    backgroundColor: "white",
    borderRadius: 15,
    paddingVertical: 12,
    width:'239px',
    height:'57px'

  },
  appButtonText: {
    fontSize: 18,
    color: "#252B63",
    fontWeight: "bold",
    alignSelf: "center",
  },
});
